import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import CustomInput from "components/CustomInput/CustomInput.jsx";
import Button from "components/CustomButtons/Button.jsx";

import workStyle from "assets/jss/material-kit-react/views/landingPageSections/workStyle.jsx";


const optionsDeparment = [
  {value: 'Amazonas', label: 'Amazonas'},
{value: 'Antioquia', label: 'Antioquia'},
{value: 'Arauca', label: 'Arauca'},
{value: 'Atlántico', label: 'Atlántico'},
{value: 'Bolívar', label: 'Bolívar'},
{value: 'Boyacá', label: 'Boyacá'},
{value: 'Caldas', label: 'Caldas'},
{value: 'Caquetá', label: 'Caquetá'},
{value: 'Casanare', label: 'Casanare'},
{value: 'Cauca', label: 'Cauca'},
{value: 'Cesar', label: 'Cesar'},
{value: 'Chocó', label: 'Chocó'},
{value: 'Córdoba', label: 'Córdoba'},
{value: 'Cundinamarca', label: 'Cundinamarca'},
{value: 'Guainía', label: 'Guainía'},
{value: 'Guaviare', label: 'Guaviare'},
{value: 'Huila', label: 'Huila'},
{value: 'La Guajira', label: 'La Guajira'},
{value: 'Magdalena', label: 'Magdalena'},
{value: 'Meta', label: 'Meta'},
{value: 'Nariño', label: 'Nariño'},
{value: 'Norte de Santander', label: 'Norte de Santander'},
{value: 'Putumayo', label: 'Putumayo'},
{value: 'Quindío', label: 'Quindío'},
{value: 'Risaralda', label: 'Risaralda'},
{value: 'San Andrés y Providencia', label: 'San Andrés y Providencia'},
{value: 'Santander', label: 'Santander'},
{value: 'Sucre', label: 'Sucre'},
{value: 'Tolima', label: 'Tolima'},
{value: 'Valle del Cauca', label: 'Valle del Cauca'},
{value: 'Vaupés', label: 'Vaupés'},
{value: 'Vichada', label: 'Vichada'},
]

class QuestionsSection extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      height: 100
    }
  }




  render() {
    const { classes } = this.props;
    var { height } = this.state;
    return (
      <div className={classes.section}>
        <GridContainer justify="center">
          <GridItem cs={12} sm={12} md={8}>

            <h2 className={classes.title}>Primero, cuentanos sobre el paciente</h2>

            <p className={classes.title}>Cuentanos información que sea agradable para el paciente.
            Si la respuesta es negativa, desconoces alguna de las respuestas o no estas seguro, deja la respuesta vacía.</p>
            <form>
              <GridContainer>

                <GridItem xs={12} sm={10} md={12}>

                  <CustomInput
                    label="Label"
                    labelText="¿Ciudad dónde vive?"
                    id="city"
                    formControlProps={{
                    fullWidth: true
                    }}
                    inputProps={{
                    onChange: this.onChange,
                    type: "text",
                    }}
                  />

                  <CustomInput
                    labelText="¿Departamento dónde vive?"
                    id="department"
                    formControlProps={{
                    fullWidth: true
                    }}
                    inputProps={{
                    onChange: this.onChange,
                    type: "text",
                    }}
                  />

                  <CustomInput
                    labelText="¿Barrio dónde vive?"
                    id="neighborhood"
                    formControlProps={{
                    fullWidth: true
                    }}
                    inputProps={{
                    onChange: this.onChange,
                    type: "text",
                    }}
                  />

                  <CustomInput
                    labelText="¿Dónde nació?"
                    id="birthCity"
                    formControlProps={{
                    fullWidth: true
                    }}
                    inputProps={{
                    onChange: this.onChange,
                    type: "text",
                    }}
                  />

                  <CustomInput
                    labelText="Profesion que ejerció o ejerce"
                    id="profession"
                    formControlProps={{
                    fullWidth: true
                    }}
                    inputProps={{
                    onChange: this.onChange,
                    type: "text",
                    }}
                  />

                  <CustomInput
